import axiosInstance from './axios';

export const getCurrentUser = async () => {
    try {
        axiosInstance
            .get("curr/")
            .then((response) => {
                const mainTeacherData = response.data[0];
                return mainTeacherData;
            })
    } catch (error) {
        console.error("Error fetching data:", error);
    }
}
